import React from "react";
import "./Nav.css";
import logo from "../assets/logo4.svg"

const Nav = () => {
  return (
    <header>
      <div className="container">
        <div className="navbar">
        <img src={logo} alt="" className="logo"/>
          <nav>
            <ul>
              <li>
                <a href="/">Projects</a>
              </li>
              <li>
                <a href="/">Contact</a>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </header>
  );
};

export default Nav;
